import Link from 'next/Link';
const About = ()=> {
    return (
    <div>
     <Link href="/"><Button>Home</Button></Link>
     <Link href="/aboutSpaceX"><Button>About SpaceX Programs</Button></Link>
       <h1> About SpaceX </h1>
    <p> It would help users list and browse all launches by SpaceX program.</p>
    </div>
    );
} 

export default About;
